import React from "react";

const Header = () => {
  var primary = "FF9ff";
  return (
    <div className="w-100 max-width: 1280px flex justify-center md:justify-between items-center">
      <div className="center logo flex items-center">
        <img src="/images/logo.png" className="w-20"></img>
        <p className="text-4xl font-medium"> Homeoz</p>
      </div>
      <div className="hidden md:flex">
        <div className="justify-self-center md:align-self-auto flex list-none items-center  ">
          <li className="mx-4">Home</li>
          <li className="mx-4">About Us</li>
          <li className="mx-4">Contact Us</li>
          <li className="mx-4">Blog</li>
        </div>
        <div className="h-11  font-bold text-white   bg-primary flex items-center px-6 ml-4 rounded-xl">
          BOOK APPOINTMENT
        </div>
      </div>
    </div>
  );
};

export default Header;
